import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import Login from './components/Login/Login';
import EmpPrivateRoute from './components/Login/EmpPrivateRoute';
import CusPrivateRoute from './components/Login/CusPrivateRoute';
import Employee from './components/Employees/EmployeeDashboard';
import WorkOrders from './components/Employees/WorkOrders';
import WorkOrderPage from './components/Employees/WorkOrderPage';
import Customers from './components/Employees/Customers';
import Files from './components/Employees/Files';
import Employees from './components/Employees/Employees';
import Customer from './components/Customers/Customer';

function App() {
  return (
    <Router>
      <Route exact path='/login' component={ Login } />
      <EmpPrivateRoute exact path='/e_dashboard' component={ Employee } />
      <EmpPrivateRoute exact path='/e_dashboard/workorders' component={ WorkOrders } />
      <EmpPrivateRoute exact path='/e_dashboard/workorders/:id' component={ WorkOrderPage } />
      <EmpPrivateRoute exact path='/e_dashboard/customers' component={ Customers } />
      <EmpPrivateRoute exact path='/e_dashboard/files' component={ Files } />
      <EmpPrivateRoute exact path='/e_dashboard/employees' component={ Employees } />
      <CusPrivateRoute exact path='/c_dashboard' component={ Customer } />
    </Router>
  );
};

export default App;
